(1, 'Strona Główna', '<h2>Witamy na stronie Filmy Oscarowe</h2>\r\n<p>Na tej stronie znajdziesz informacje o filmach, które zdobyły Oscara w różnych kategoriach. Dowiedz się więcej o reżyserach, aktorach i inspirujących historiach.</p>\r\n<div id=\"zegarek\"></div>\r\n<div id=\"data\"></div>', 1, NULL),
(2, 'Lista filmów', '<h2>Lista Filmów Oscarowych</h2>\n<div id=\"lista\">\n<table>\n    <tr>\n        <th>Gladiator</th>\n        <th>Ridley Scott</th>\n        <th>2000</th>\n    </tr>\n    <tr>\n        <td>Forrest Gump</td>\n        <td>Robert Zemeckis</td>\n        <td>1994</td>\n    </tr>\n    <tr>\n        <td>Titanic</td>\n        <td>James Cameron</td>\n        <td>1997</td>\n    </tr>\n    <tr>\n        <td>Parasite</td>\n        <td>Bong Joon-ho</td>\n        <td>2019</td>\n    </tr>\n    <tr>\n        <td>Rocky</td>\n        <td>John G. Avildsen</td>\n        <td>1976</td>\n    </tr>\n</table>\n</div>', 1, NULL),
(3, 'Galeria', '<h2>Galeria Filmów Oscarowych</h2>\n<div class=\"gallery\">\n    <div class=\"gallery-item\">\n        <h3>Gladiator</h3>\n        <img src=\"img/film1.jpg\" alt=\"Gladiator\"> \n    </div>\n    <div class=\"gallery-item\">\n        <h3>Forrest Gump</h3>\n        <img src=\"img/film2.jpg\" alt=\"Forrest Gump\"> \n    </div>\n    <div class=\"gallery-item\">\n        <h3>Titanic</h3>\n        <img src=\"img/film3.jpg\" alt=\"Titanic\"> \n    </div>\n    <div class=\"gallery-item\">\n        <h3>Parasite</h3>\n        <img src=\"img/film4.jpg\" alt=\"Parasite\"> \n    </div>\n    <div class=\"gallery-item\">\n        <h3>Rocky</h3>\n        <img src=\"img/film5.jpg\" alt=\"Rocky\"> \n    </div>\n</div>', 1, NULL),
(4, 'O nas', '<h2>O Nas</h2>\n<p>Jestem osobą pasjonującą się kinem, która chce podzielić się swoją miłością do filmów nagrodzonych Oscarem. Moja misja to promowanie najlepszych produkcji filmowych.</p>', 1, NULL),
(5, 'Filmy', '<h2>3 Niezwykłe Filmy</h2>\n<div class=\"film-container\">\n    <!-- Film 1: Gladiator -->\n    <div class=\"film\">\n        <h3>Gladiator (2000)</h3>\n        <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/owK1qxDselE\" \n                title=\"Gladiator Trailer\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen>\n        </iframe>\n    </div>\n\n    <!-- Film 2: Forrest Gump -->\n    <div class=\"film\">\n        <h3>Forrest Gump (1994)</h3>\n        <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/bLvqoHBptjg\" \n                title=\"Forrest Gump Trailer\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen>\n        </iframe>\n    </div>\n\n    <!-- Film 3: Titanic -->\n    <div class=\"film\">\n        <h3>Titanic (1997)</h3>\n        <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/kVrqfYjkTdQ\" \n                title=\"Titanic Trailer\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen>\n        </iframe>\n    </div>\n</div>', 1, NULL),
(6, 'Kontakt', '<h2>Kontakt</h2>\n<form action=\"d.danelczyk123@gmail.com\" method=\"post\" enctype=\"text/plain\">\n    <label for=\"name\">Imię:</label><br>\n    <input type=\"text\" id=\"name\" name=\"name\" required><br><br>\n    <label for=\"email\">E-mail:</label><br>\n    <input type=\"email\" id=\"email\" name=\"email\" required><br><br>\n    <label for=\"message\">Wiadomość:</label><br>\n    <textarea id=\"message\" name=\"message\" rows=\"5\" required></textarea><br><br>\n    <button type=\"submit\">Wyślij</button>\n</form>', 1, NULL);

